import React from 'react';
import "./style.css";
import { Form, Input, TextArea, Button } from 'semantic-ui-react';

const FormExampleFieldControlId = () => (

  <Form action="mailto:charr.mt@gmail.com"  method="post" enctype="text/plain" className="formF"inverted>
    <Form.Group to="address@gmail.com" widths='equal'>
    {/* <ReactContactForm to="address@gmail.com" /> */}
      <Form.Field
      type="text" name="name"
      className="form"
        id='form-input-control-first-name'
        control={Input}
        label='Name'
      />
      <Form.Field
      type="text" name="mail"
        id='form-input-control-last-name'
        control={Input}
        label='E-mail'

      />
    </Form.Group>
    <Form.Field
    type="text" name="comment"
      id='form-textarea-control-opinion'
      control={TextArea}
      label='Message'

    />
    <Form.Field
      control={Button}
      icon='mail'
// onclick=post request
    />
  </Form>
)

export default FormExampleFieldControlId
